import React, { Suspense, lazy } from "react";
import { Route, Routes } from "react-router-dom";
import Loader from "./Global/Loader";
import Layout from "./Global/Layout";
import PrivateRoute from "./Routes/PrivateRoute";
import AdminRoute from "./Routes/AdminRoute";
import AuthProvider from "./Context/AuthContext";

// Pages
const Home = lazy(() => import("./Pages/Home"));
const Contact = lazy(() => import("./Pages/Contact"));
const Collection = lazy(() => import("./Pages/Collection"));
const ProductDetails = lazy(() => import("./Collection/ProductDetails"));
const FAQs = lazy(() => import("./Pages/Faq"));
const Certification = lazy(() => import("./Pages/Certification"));
const CustomizeJewellery = lazy(() => import("./Pages/CustomizeJewellery"));
const LabVsNatural = lazy(() => import("./Pages/LabVsNatural"));
const Thediamonds = lazy(() => import("./Pages/Thediamonds"));
const About = lazy(() => import("./Pages/About"));
const CategoryPage = lazy(() => import("./Collection/CategoryPage"));
const Register = lazy(() => import("./Componet/auth/Register"));
const Login = lazy(() => import("./Componet/auth/Login"));
const ForgotPassword = lazy(() => import("./Componet/auth/ForgotPassword"));
const ResetPassword = lazy(() => import("./Componet/auth/ResetPassword"));
const Wishlist = lazy(() => import("./Pages/Wishlist"));
const Cart = lazy(() => import("./Pages/Cart"));
const AdminDashboard = lazy(() => import("./Pages/AdminDashboard"));
const UserDashboard = lazy(() => import("./Pages/UserDashboard"));

function App() {
  return (
    <AuthProvider>
      <Layout>
        <Suspense fallback={<Loader />}>
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home />} />
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<Login />} />
            <Route path="/forgot-password" element={<ForgotPassword />} />
            <Route path="/reset-password" element={<ResetPassword />} />
            <Route path="/collection" element={<Collection />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/faq" element={<FAQs />} />
            <Route path="/about" element={<About />} />

            {/* Private Routes (Only for Logged-in Users) */}
            <Route path="/wishlist" element={<PrivateRoute element={<Wishlist />} />} />
            <Route path="/cart" element={<PrivateRoute element={<Cart />} />} />
            <Route path="/customize-jewelry" element={<PrivateRoute element={<CustomizeJewellery />} />} />
            <Route path="/certification" element={<PrivateRoute element={<Certification />} />} />
            <Route path="/product/:productId" element={<PrivateRoute element={<ProductDetails />} />} />
            <Route path="/category/:categoryId" element={<PrivateRoute element={<CategoryPage />} />} />
            <Route path="/lab-vs-natural" element={<PrivateRoute element={<LabVsNatural />} />} />
            <Route path="/the-4-cs-of-diamonds" element={<PrivateRoute element={<Thediamonds />} />} />

            {/* Admin Routes */}
            <Route path="/admin-dashboard" element={<AdminRoute element={<AdminDashboard />} />} />

            {/* User Dashboard */}
            <Route path="/user-dashboard" element={<PrivateRoute element={<UserDashboard />} />} />
          </Routes>
        </Suspense>
      </Layout>
    </AuthProvider>
  );
}

export default App;
